DROP TABLE IF EXISTS `patient_visits`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `patient_visits` (
  `visit_ID` int NOT NULL,
  `date_of_visit` date NOT NULL,
  `patient_ID` int NOT NULL,
  `location_ID` int NOT NULL,
  `staff_ID` int NOT NULL,
  `test_result` varchar(30) NOT NULL,
  `symptom1_ID` int DEFAULT NULL,
  `symptom2_ID` int DEFAULT NULL,
  `symptom3_ID` int DEFAULT NULL,
  PRIMARY KEY (`visit_ID`),
  UNIQUE KEY `visit_ID` (`visit_ID`),
  KEY `fk_patient_ID` (`patient_ID`),
  KEY `fk_location_ID2` (`location_ID`),
  KEY `fk_staff_ID` (`staff_ID`),
  KEY `fk_symptoms` (`symptom1_ID`),
  KEY `fk_symptoms2` (`symptom2_ID`),
  KEY `fk_symptoms3` (`symptom3_ID`),
  CONSTRAINT `fk_location_ID2` FOREIGN KEY (`location_ID`) REFERENCES `centre_location` (`location_ID`),
  CONSTRAINT `fk_patient_ID` FOREIGN KEY (`patient_ID`) REFERENCES `patient_info` (`patient_ID`),
  CONSTRAINT `fk_staff_ID` FOREIGN KEY (`staff_ID`) REFERENCES `staff` (`staff_ID`),
  CONSTRAINT `fk_symptoms` FOREIGN KEY (`symptom1_ID`) REFERENCES `symptoms` (`symptom_ID`),
  CONSTRAINT `fk_symptoms2` FOREIGN KEY (`symptom2_ID`) REFERENCES `symptoms` (`symptom_ID`),
  CONSTRAINT `fk_symptoms3` FOREIGN KEY (`symptom3_ID`) REFERENCES `symptoms` (`symptom_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
